import React, { useState, useEffect } from "react";
import { useHistory } from 'react-router-dom';
import './Cart.css';
function Cart(){
    const history = useHistory();
    const username = sessionStorage.getItem("username");
    //const userID = sessionStorage.getItem("userID");
    const [msg,setMsg] = useState("");
    const navigateTo = (page) =>{
        if(page === 'Cart'){
            history.push("/Cart");
        }
        else if(page === 'Dashboard'){
            history.push("/Dashboard");
        }
        
    }
    return(
        <>
             <nav className="navbar navbar-inverse">
                 <div className="container-fluid">
                      <div className="navbar-header">
                          <a href="#" className="navbar-brand title" onClick={() =>navigateTo("Dashboard")}>MedApp</a>
                      </div>
                     <ul className="nav navbar-nav navbar-right">
                        <li><a href="#" className="list" onClick={() =>navigateTo("Cart")}><i className="fa fa-shopping-cart" /> your cart () </a></li>
                        <li><a className="list"><span className="glyphicon glyphicon-user"></span>Hi, {username}</a></li>
                     </ul>
                 </div>
             </nav>
             <p className="NoData">{msg}</p> 
             <div className="container-fluid">
                <div className="row">
                
                </div>
             </div>
        </>
    );
}
export default Cart;
